import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useNavigate } from 'react-router-dom';

// Mail Page: The page where the "Compose Email" button is located
const MailPage = () => {
  const navigate = useNavigate();

  const handleMailClick = () => {
    // Navigate to the compose email page
    navigate('/compose-email');
  };

  return (
    <div className="mail-page">
      <h1>Mail Page</h1>
      <button onClick={handleMailClick}>Compose Email</button>
    </div>
  );
};

// Compose Email Page: The page where the user can compose an email
const ComposeEmailPage = () => {
  return (
    <div className="compose-email-page">
      <h1>Compose an Email</h1>
      <form>
        <label>
          To:
          <input type="email" name="to" placeholder="Recipient's Email" />
        </label>
        <br />
        <label>
          Subject:
          <input type="text" name="subject" placeholder="Subject" />
        </label>
        <br />
        <label>
          Message:
          <textarea name="message" placeholder="Your message..." />
        </label>
        <br />
        <button type="submit">Send</button>
      </form>
    </div>
  );
};

// App Component with Router Setup
const App = () => {
  return (
    <Router>
      <div className="app-container">
        <h1>React Mail App</h1>
        <nav>
          <ul>
            <li>
              <Link to="/mail">Go to Mail Page</Link>
            </li>
            <li>
              <Link to="/compose-email">Go to Compose Email</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/mail" element={<MailPage />} />
          <Route path="/compose-email" element={<ComposeEmailPage />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
